import React, { useState } from "react";

const CoinChart = ({ coinId, coinName }) => {
  const headerData = [
    [1, "1 jour"],
    [3, "3 jour"],
    [7, "7 jour"],
    [30, "1 mois"],
    [91, "3 mois"],
    [181, "6 mois"],
    [365, "1 an"],
    [3000, "Max"],
  ];

  return (
    <div className="coin-chart">
      <p>{coinName}</p>
      <div className="btn-container">
        {headerData.map((el) => {
          return <div htmlFor={"btn" + el[0]}>{el[1]}</div>;
        })}
      </div>
    </div>
  );
};

export default CoinChart;
